import React from 'react';
import { Link } from 'react-router-dom';
const Error = () => {
  return (
    <div>
        <h1 className='o'>Page Not Found</h1>
         <Link to='/MyPages'> GO BACK TO HOME PAGE </Link>
      
    </div>
  )
}

export default Error
